import React from 'react';

// function keys (){
// 	return <h1>Welcome to see a demo of keys</h1>
// }


// export default keys;

import ReactDOM from "react-dom";
// Component to be extracted
function keys(props) {
	const item = props.item;
	return <li>{item}</li>;
}

// Component that will return an
// unordered list
function Navmenu(props) {
	const list = props.keys;
	const updatedList = list.map((listItems) => {
		return <keys key={listItems.toString()} item={listItems} />;
	});

	return <ul>{updatedList}</ul>;
}

const keys1 = [1, 2, 3, 4, 5];
const keys2 = [1, 2, 3, 4, 5, 6];

ReactDOM.render(
	<div>
		<Navmenu keys={keys1} />
		<Navmenu keys={keys2} />
	</div>
	// document.getElementById("root")
);

export default keys;
